script: |
  super -f text -I q4630.spq | sort > q4630.out

inputs:
  - name: q4630.spq
    data: |
      SELECT DISTINCT + col1 * col1 AS col2 FROM tab1 (FORMAT parquet) AS cor0 WHERE - cor0.col1 / + col0 < ( + col0 * col2 + + col1 );
  - name: tab1

outputs:
  - name: q4630.out
    data: |
      100
      169
      676
